// Libs
import React, { Component } from 'react';
import mapboxgl from 'mapbox-gl';

// Images
import MarkerIcon from '../assets/marker.svg';

//import Elastic from '@elastic/elasticsearch';
//const client = new Elastic({ node: 'https://elastic:RMwayjd0u1A7YeQZfLv1wEdY@761fe4305be441e1b752de16019635c9.us-east-1.aws.found.io:9243' })

//endpoint: https://761fe4305be441e1b752de16019635c9.us-east-1.aws.found.io:9243
//username: elastic
//senha: RMwayjd0u1A7YeQZfLv1wEdY

mapboxgl.accessToken = 'pk.eyJ1IjoiaWdvcmNvdXRvIiwiYSI6ImNrOWZudjNtcTAyd3EzbHI3a2ppbnpnemUifQ.D--CSyWyEk70oULTVok7vg';

class Menu extends Component {

  state = {
    isMapping: false,
  };

  handleIsMappingOpen = () => {
    this.setState({ 
      isMapping: !this.state.isMapping,
    });
  }

  renderMapping = () => (
    <div className="container_mapping">
      <div className="container_mapping-item">
        <div className="mapping_item-checkbox">check</div>
        <p className="mapping_item-text">Sócio-Econômico</p>
      </div>
      <div className="container_mapping-item">
        <div className="mapping_item-checkbox">check</div>
        <p className="mapping_item-text">Demandas e Entregas</p>
      </div>
      <div className="container_mapping-item">
        <div className="mapping_item-checkbox">check</div>
        <p className="mapping_item-text">ONG's</p>
      </div>
    </div>
  )

  render() {
    return (
      <aside className="container_home">
        <span className="container_home-circle"></span>
        <button
          className="container_home-button"
          style={{background: this.state.isMapping ? '#F7BBA9' : null}}
          onClick={this.handleIsMappingOpen}
        >
          <p className="home_button-title">Mapeamento</p>
        </button>
        {this.state.isMapping && this.renderMapping()}
        <button className="container_home-button">
          <p className="home_button-title">Estatísticas</p>
        </button>
        <button className="container_home-button">
          <p className="home_button-title">Strech</p>
        </button>
    </aside>
    );
  }
}

export default Menu;
